import { useEffect } from "react";
//import { useNavigate } from "react-router-dom";
//import jwt from 'jsonwebtoken';

const User = () => {

    useEffect(() => {
        const token = localStorage.getItem('token');
        if (token) {
            const decodedToken = jwt.decode(token);
            console.log(decodedToken);
        } else {
            console.log('bye');
        }
    }, [])

    return (
        <h2>User Profile</h2>
    )
}

export default User
